import Square from "./Square";
import CounterButtons from "./CounterButtons";

const Counter = () => {
    return (
        <div className="row">
            <div className=" col-3">
                <Square />
            </div>
            <div className="col-6">
                <CounterButtons />

            </div>
        </div>
    );
}
export default Counter;
